import React from "react";
import "./App.css";

import QuoteBox from "./QuoteBox";
import Footer from "./Footer";

class App extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (

      <App>
        <QuoteBox />
        <Footer />
      </App>
    );
  }
}

export default App;
